import axios from 'axios';
// import axiosClient from './axiosClient';

const AdminAPI = {
  postSignIn: (user) => {
    return axios({
      method: 'post',
      url: 'http://localhost:5000/admin/signin',
      data: user,
      withCredentials: true,
    });
  },

  getLogout: () => {},

  getProduces: () => {
    return axios({
      method: 'get',
      url: 'http://localhost:5000/admin/get-products',
      withCredentials: true,
    });
  },
};

export default AdminAPI;
